import React from 'react'
import "./footer.css";

import { Container, Row, Col, ListGroup, ListGroupItem } from 'reactstrap';

import { Link } from 'react-router-dom';
import logo from "../../assets/images/logo.png";

const quick__links = [
  {
      path: '/home',
      display: 'Trang chủ'
  },
  {
      path: '/tours',
      display: 'Khám phá'
  },
  {
      path: '/about',
      display: 'Giới thiệu'
  },
];
const quick__links2 = [
  {
      path: '/home',
      display: 'Trang chủ'
  },
  {
      path: '/login',
      display: 'Đăng nhập'
  },
  {
      path: '/register',
      display: 'Đăng ký'
  },
];

const Footer = () => {
  return (
    <footer className="footer">
      <Container>
        <Row>
          <Col lg="3">
            <img src={logo} alt="" />
            <p></p>
          </Col>
        </Row>
      </Container>
    </footer>
  )
}

export default Footer
